import React from "react";

interface IProps {
  url: string;
}

const ImageMessage: React.FC<IProps> = ({ url }) => {
  return <img style={{maxHeight: "900px", maxWidth: "900px", minHeight: "1px", minWidth: "1px"}} alt="url" src={url} />;
};

export default ImageMessage;
